'''
Special Strings follow either of the following rules
- all characters are the same e.g. 'aaa'
- all characters except the middle one are the same e.g. 'aadaa'
'''

# Complete the substrCount function below.


def substrCount(n, s):
    # all single characters are special strings
    ss_cnt = len(s)
    for i in range(len(s)):
        for j in range(i + 1, len(s)):
            if s[i] == s[j]:
                # if both end characters are equal and else hasn't triggered yet, this is a special string
                ss_cnt += 1
            else:
                # if we see a different character, check range before change against same range after change
                # aabaa --> [aab]aa --> [aa] == [aa] --> special
                # aabcd --> [aab]cd --> [aa] != [cd] --> !special
                if 2 * j - i < len(s) and s[i:j] == s[j+1:2*j-i+1]:
                    ss_cnt += 1
                break
    return ss_cnt

tests = [
    'mnonopoo',     # 12
    'asasd',        # 7
    'abcbaba',      # 10
    'aaaa'         # 10
    # 1272929
    ''
]

results = []

for s in tests:
    results.append(substrCount(len(s), s))

print(results)
